INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (1, '美丽人生', '犹太青年圭多（罗伯托·贝尼尼）邂逅美丽的女教师多拉（尼可莱塔·布拉斯基），他彬彬有礼的向多拉鞠躬：“早安！公主！”。历经诸多令人啼笑皆非的周折后，天遂人愿，两人幸福美满的生活在一起。', '1997-12-20 00:00:00', 1, 'cover001.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=1900622863&bvid=BV1tm411D73w&cid=1438380993&p=1&danmaku=0', '意大利', 'comedy', 9.5);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (2, '三傻大闹宝莱坞', '本片根据印度畅销书作家奇坦·巴哈特（Chetan Bhagat）的处女作小说《五点人》（Five Point Someone）改编而成。法兰（马德哈万 R Madhavan 饰）、拉杜（沙曼·乔希 Sharman Joshi 饰）与兰乔（阿米尔·汗 Aamir Khan 饰）是皇家工程学院的学生，三人共居一室，结为好友。在以严格著称的学院里，兰乔是个非常与众不同的学生，他不死记硬背，甚至还公然顶撞校长“病毒”（波曼·伊拉尼 Boman Irani 饰），质疑他的教学方法。他不仅鼓动法兰与拉杜去勇敢追寻理想，还劝说校长的二女儿碧雅（卡琳娜·卡普 Kareena Kapoor 饰）离开满眼铜臭的未婚夫。兰乔的特立独行引起了模范学生“消音器”（奥米·维嘉 Omi Vaidya 饰）的不满，他约定十年后再与兰乔一决高下，看哪种生活方式更能取得成功。', '2009-12-25 00:00:00', 0, 'cover002.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=953322662&bvid=BV1qs4y137UU&cid=1118932077&p=1&danmaku=0', '印度', 'comedy', 9.2);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (3, '机器人总动员', '公元2805年，人类文明高度发展，却因污染和生活垃圾大量增加使得地球不再适于人类居住。地球人被迫乘坐飞船离开故乡，进行一次漫长无边的宇宙之旅。临行前他们委托Buynlarge的公司对地球垃圾进行清理，该公司开发了名为WALL·E（Waste Allocation Load Lifters – Earth 地球废品分装员）的机器人担当此重任。', '2008-06-27 00:00:00', 1, 'cover003.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=272146418&bvid=BV1yc411u7oU&cid=1161489080&p=1&danmaku=0', '美国', 'animation', 9.3);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (4, '无间道', '1991年，香港黑帮三合会会员刘健明（刘德华）听从老大韩琛（曾志伟）的吩咐，加入警察部队成为黑帮卧底，韩琛许诺刘健明会帮其在七年后晋升为见习督察。1992年，警察训练学校优秀学员陈永仁（梁朝伟）被上级要求深入到三合会做卧底，终极目标是成为韩琛身边的红人。2002年，两人都不负重望，也都身背重压，刘健明渐想成为一个真正的好人，陈永仁则盼着尽快回归警察身份。', '2002-12-12 00:00:00', 1, 'cover004.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=406511029&bvid=BV15V411w7gE&cid=1282454600&p=1&danmaku=0', '中国', 'action', 9.3);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (5, '大话西游之大圣娶亲', '至尊宝（周星驰 饰）被月光宝盒带回到五百年前，遇见紫霞仙子（朱茵 饰），被对方打上烙印成为对方的人，并发觉自己已变成孙悟空。', '1995-02-04 00:00:00', 0, 'cover005.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=313529800&bvid=BV15P411R7CL&cid=1127381652&p=1&danmaku=0', '中国', 'comedy', 9.2);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (6, '千与千寻', '千寻和爸爸妈妈一同驱车前往新家，在郊外的小路上不慎进入了神秘的隧道——他们去到了另外一个诡异世界—一个中世纪的小镇。远处飘来食物的香味，爸爸妈妈大快朵颐，孰料之后变成了猪！这时小镇上渐渐来了许多样子古怪、半透明的人。', '2001-07-20 00:00:00', 1, 'cover006.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=639712771&bvid=BV18Y4y1x7gZ&cid=738313872&p=1&danmaku=0', '日本', 'animation', 9.4);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (7, '这个杀手不太冷', '里昂（让·雷诺饰）是名孤独的职业杀手，受人雇佣。一天，邻居家小姑娘马蒂尔达（纳塔丽·波特曼饰)敲开他的房门，要求在他那里暂避杀身之祸。原来邻居家的主人是警方缉毒组的眼线，只因贪污了一小包毒品而遭恶警（加里·奥德曼饰）杀害全家的惩罚。马蒂尔达得到里昂的留救，幸免于难，并留在里昂那里。里昂教小女孩使枪，她教里昂法文，两人关系日趋亲密，相处融洽。', '1994-09-14 00:00:00', 1, 'cover007.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=622113405&bvid=BV1ub4y157rw&cid=1363347884&p=1&danmaku=0', '法国', 'action', 9.4);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (8, '疯狂动物城', '故事发生在一个所有哺乳类动物和谐共存的美好世界中，兔子朱迪（金妮弗·古德温 Ginnifer Goodwin 配音）从小就梦想着能够成为一名惩恶扬善的刑警，凭借着智慧和努力，朱迪成功的从警校中毕业进入了疯狂动物城警察局，殊不知这里是大型肉食类动物的领地，作为第一只，也是唯一的小型食草类动物，朱迪会遇到怎样的故事呢？', '2016-03-04 00:00:00', 1, 'cover008.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=1002714811&bvid=BV1Mx4y1Y7gG&cid=1493729988&p=1&danmaku=0', '美国', 'animation', 9.2);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (9, '怦然心动', '布莱斯（卡兰•麦克奥利菲 Callan McAuliffe 饰）全家搬到小镇，邻家女孩朱丽（玛德琳•卡罗尔 Madeline Carroll 饰）前来帮忙。她对他一见钟情，心愿是获得他的吻。两人是同班同学，她一直想方设法接近他，但是他避之不及。她喜欢爬在高高的梧桐树上看风景。但因为施工，树被要被砍掉，她誓死捍卫，希望他并肩作战，但是他退缩了。她的事迹上了报纸，外公对她颇有好感，令他十分困惑。她凭借鸡下蛋的项目获得了科技展第一名，成了全场焦点，令他黯然失色。她把自家鸡蛋送给他，他听家人怀疑她家鸡蛋不卫生，便偷偷把鸡蛋丢掉。她得知真相，很伤心，两人关系跌入冰点。她跟家人诉说，引发争吵。原来父亲一直攒钱照顾傻弟弟，所以生活拮据。她理解了父母，自己动手，还得到了他外公的鼎力相助。他向她道歉，但是并未解决问题。他开始关注她。鸡蛋风波未平，家庭晚宴与午餐男孩评选...', '2010-07-26 00:00:00', 1, 'cover009.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=973931099&bvid=BV1G44y1q7Rm&cid=363489530&p=1&danmaku=0', '美国', 'comedy', 9.1);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (10, '蝙蝠侠：黑暗骑士', '从亲眼目睹父母被人杀死的阴影中走出来的“蝙蝠侠”，经历了成长之后，已经不再是那个桀骜不的孤单英雄了。在警官吉姆·戈登和检查官哈维·登特的通力帮助下，“蝙蝠侠”无后顾之忧地继续满世界的奔波，与日益增长起来的犯罪威胁做着永无休止的争斗，而他所在的高谭市，也是进展最为明显的地方，犯罪率以一种惊人的速度持续下降着，毕竟对方是能够上天入地的“蝙蝠侠”，不借两个胆子谁还敢造次呢？不过像高谭这种科技与污秽并存的城市，平静是不可能维持太久的，果不其然，新一轮的混乱很快就席卷了整个城市，人们再一被被恐慌所笼罩着，而声称愿意为这一切负责的，自然就是所有混乱的源头以及支配者--“小丑”了。　　先不管“小丑”掀起一个又一个犯罪的狂潮的最终目的为何，他的企图都是邪恶的，所作所为更是早就危害到了高谭市民的正常生活……其中自然包括了“蝙蝠侠”身边几个非常重要的人，而他需要做的，就是将这股新的危机全部亲自用手捏得粉碎。然而在面对着这个有史以来最具针对性、最恶毒的对手时，“蝙蝠侠”却不得不从他的地下军械库里搬出每一件能够用得上的高科技武器，还得时刻纠结着为他曾经信仰的一切寻找答案。', '2008-07-14 00:00:00', 1, 'cover010.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=91072365&bvid=BV11j411f7or&cid=155515068&p=1&danmaku=0', '美国', 'action', 9.2);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (11, '我不是药神', '普通中年男子程勇（徐峥 饰）经营着一家保健品店，失意又失婚。不速之客吕受益（王传君 饰）的到来，让他开辟了一条去印度买药做“代购”的新事业，虽然困难重重，但他在这条“买药之路”上发现了商机，一发不可收拾地做起了治疗慢粒白血病的印度仿制药独家代理商。赚钱的同时，他也认识了几个病患及家属，为救女儿被迫做舞女的思慧（谭卓 饰）、说一口流利“神父腔”英语的刘牧师（杨新鸣 饰），以及脾气暴烈的“黄毛”（章宇 饰），几个人合伙做起了生意，利润倍增的同时也危机四伏。程勇昔日的小舅子曹警官（周一围 饰）奉命调查仿制药的源头，假药贩子张长林（王砚辉 饰）和瑞士正牌医药代表（李乃文 饰）也对其虎视眈眈，生意逐渐变成了一场关于救赎的拉锯战。', '2018-07-05 00:00:00', 1, 'cover011.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=1604781635&bvid=BV1rm421M7Eq&cid=1552303430&p=1&danmaku=0', '中国', 'comedy', 9.0);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (12, '飞屋环游记', '小男孩卡尔（Carl Fredricksen）怀揣着对于冒险的热爱偶遇假小子艾丽（Ellie），而艾丽把整个屋子当成一艘大飞船游戏居然使他对这个女孩子有些着迷，相同的爱好最终使两个人成为了一生的爱侣。', '2009-05-13 00:00:00', 0, 'cover012.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=910501174&bvid=BV1vM4y187ze&cid=1113000642&p=1&danmaku=0', '美国', 'animation', 9.1);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (13, '让子弹飞', '民国年间，花钱捐得县长的马邦德（葛优 饰）携妻（刘嘉玲 饰）及随从走马上任。途经南国某地，遭劫匪张麻子（姜文 饰）一伙伏击，随从尽死，只夫妻二人侥幸活命。马为保命，谎称自己是县长的汤 师爷。为汤师爷许下的财富所动，张麻子摇身一变化身县长，带着手下赶赴鹅城上任。有道是天高皇帝远，鹅城地处偏僻，一方霸主黄四郎（周润发 饰）只手遮天，全然不将这个新来的县长放在眼里。张麻子痛打了黄的武教头（姜武 饰），黄则设计害死张的义子小六（张默 饰）。原本只想赚钱的马邦德，怎么也想不到竟会被卷入这场土匪和恶霸的角力之中。鹅城上空愁云密布，血雨腥风在所难免……', '2010-12-16 00:00:00', 0, 'cover013.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=602799733&bvid=BV1FB4y137dg&cid=827164589&p=1&danmaku=0', '中国', 'comedy', 9.0);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (14, '指环王2：双塔奇兵', '第二部在延续第一部风格的同时，故事呈现出多线发展的格局，情节有了更高的观赏性。　　第一部结尾，博罗米尔被强兽人杀死之后，两个霍比特人皮平和梅利也被强兽人绑架，阿拉贡、精灵莱戈拉斯（奥兰多·布鲁姆 饰）、侏儒金利一路追踪强兽人，营救皮平和梅利，遇到了“复活”的白袍巫师甘道夫 （伊恩·麦克莱恩 饰）。此时，投降索伦的白袍巫师萨鲁曼控制了人类洛汉王国的国王，并派出大量的强兽人军队，准备消灭人类。阿拉贡、莱戈拉斯和金利在甘道夫的带领下，帮助洛汉王国对抗邪恶力量的入侵。　　幸运的皮平和梅利被会说话的树精救了出来，并且遇到“复活”的甘道夫，在甘道夫的授意下，树精保护了两人的安全，并且带他们参加树精大会，大会上，树精们讨论对待中土大战的态度：是继续当中立者，逆来顺受，还是奋起反抗？', '2005-12-05 00:00:00', 1, 'cover014.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=86768165&bvid=BV1G7411W7zg&cid=148274394&p=1&danmaku=0', '美国', 'action', 9.0);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (15, '罗马假日', '欧洲某国的安妮公主（奥黛丽·赫本 Audrey Hepburn 饰）到访罗马，国务烦身，但她又厌倦繁文缛节。一天晚上，身心俱疲的她偷偷来到民间欣赏夜景，巧遇报社记者乔（格里高利·派克 Gregory Peck 饰）。二人把手同游，相当快乐。公主更是到乔的家中作客并在那过夜。不料乔无意中发现了公主的真实身份，他决定炮制一个独家新闻，于是乔和朋友、摄影师欧文（埃迪·艾伯特 Eddie Albert 饰）一起带公主同游罗马，并且偷拍了公主的很多生活照。然而，在接下来与公主的相处中，乔不知不觉恋上了公主。为了保护公主的形象，乔只能忍痛抛弃功成名就的良机，将照片送予了公主。　　安妮公主在经历了罗马一日假期后，反而体验了自己对国家的责任，毅然返回了大使馆，为了本身的责任而果断抛弃了爱情。', '1953-08-20 00:00:00', 0, 'cover015.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=448357580&bvid=BV1Cj411C7X7&cid=1263267083&p=1&danmaku=0', '美国', 'comedy', 9.1);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (16, '黑客帝国', '不久的将来，网络黑客尼奥（基奴李维斯 饰）对这个看似正常的现实世界产生了怀疑。他结识了黑客崔妮蒂（凯莉·安·摩丝 饰），并见到了黑客组织的首领墨菲斯（劳伦斯·菲什伯恩 饰）。墨菲斯告诉他，现实世界其实是由一个名叫“母体”的计算机人工智能系统控制，人们就像他们饲养的动物，没有自由和思想，而尼奥就是能够拯救人类的救世主。', '1999-03-31 00:00:00', 1, 'cover016.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=5598746&bvid=BV1Ls411C7we&cid=9094137&p=1&danmaku=0', '美国', 'action', 9.1);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (17, '狮子王', '辛巴是狮子王国的小王子，他的父亲穆法沙是一个威严的国王。然而叔叔刀疤却对穆法沙的王位觊觎已久。　　要想坐上王位宝座，刀疤必须除去小王子。于是，刀疤利用种种借口让辛巴外出，然后伺机大开杀戒，无奈被穆法沙即时来救。在反复的算计下，穆法沙惨死在刀疤手下，刀疤别有用心的劝辛巴离开，一方面派人将他赶尽杀绝。　　辛巴逃亡中遇到了机智的丁满和善良的彭彭，他们抚养辛巴长成雄壮的大狮子，鼓励他回去森林复国。在接下来一场复国救民的斗争中，辛巴真正长成一个坚强的男子汉，领会了责任的真谛。', '1994-06-15 00:00:00', 0, 'cover017.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=71519597&bvid=BV19E411C7vw&cid=123929763&p=1&danmaku=0', '美国', 'animation', 9.1);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (18, '穿条纹睡衣的男孩', '八岁男孩布鲁诺（Asa Butterfield 饰）一家随着纳粹军官父亲的一纸调令，由柏林搬迁到了乡下。失去了朋友们的布鲁诺很快对新家附近的“农庄”产生了兴趣，那里有一群身穿“条纹睡衣”的人终日忙碌，并且其中一个为布鲁诺一家服务，他形容肮脏，态度慎微。周遭环境和布鲁诺的举止让母亲暗暗担忧，但纳粹父亲制止家中任何怀疑既定政策的行为。', '2008-08-28 00:00:00', 1, 'cover018.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=955307049&bvid=BV1us4y1F7xq&cid=1179386655&p=1&danmaku=0', '英国', 'action', 9.2);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (19, '两杆大烟枪', '艾迪（尼克·莫伦）思维敏捷，是个玩牌高手。在三个好友的支持下，艾迪携巨资参加了黑社会的高额赌局，不想落入圈套，欠下50万的赌债。为了还清赌债，艾迪和朋友们绞尽脑汁，最终算计到一群毒贩身上，并为打劫购买了两杆老式烟枪。', '1998-08-28 00:00:00', 0, 'cover019.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=14875108&bvid=BV1Fx411V7T7&cid=24236878&p=1&danmaku=0', '英国', 'comedy', 9.1);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (20, '看不见的客人', '艾德里安（马里奥·卡萨斯 Mario Casas 饰）经营着一间科技公司，事业蒸蒸日上，家中有美丽贤惠的妻子和活泼可爱的女儿，事业家庭双丰收的他是旁人羡慕的对象。然而，野心勃勃的艾德里安并未珍惜眼前来之不易的生活，一直以来，他和一位名叫劳拉（芭芭拉·蓝妮 Bárbara Lennie 饰）的女摄影师保持着肉体关系。　　某日幽会过后，两人驱车离开别墅，却在路上发生了车祸，为了掩盖事件的真相，两人决定将在车祸中死去的青年丹尼尔联同他的车一起沉入湖底。之后，劳拉遇见了一位善良的老人，老人将劳拉坏掉的车拉回家中修理，然而，令劳拉没有想到的是，这位老人，竟然就是丹尼尔的父亲。', '2016-09-23 00:00:00', 1, 'cover020.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=576916610&bvid=BV1Yz4y1F7iy&cid=1292936823&p=1&danmaku=0', '西班牙', 'action', 8.8);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (21, '阿凡达', '战斗中负伤而下身瘫痪的前海军战士杰克·萨利（萨姆·沃辛顿 Sam Worthington 饰）决定替死去的同胞哥哥来到潘多拉星操纵格蕾丝博士（西格妮·韦弗 Sigourney Weaver 饰）用人类基因与当地纳美部族基因结合创造出的 “阿凡达” 混血生物。杰克的目的是打入纳美部落，外交说服他们自愿离开世代居住的家园，从而SecFor公司可砍伐殆尽该地区的原始森林，开采地下昂贵的“不可得”矿。在探索潘多拉星的过程中，杰克遇到了纳美部落的公主娜蒂瑞（佐伊·索尔达娜 Zoe Saldana 饰），向她学习了纳美人的生存技能与对待自然的态度。与此同时，SecFor公司的经理和军方代表上校迈尔斯（史蒂芬·朗 Stephen Lang 饰）逐渐丧失耐心，决定诉诸武力驱赶纳美人……', '2009-12-18 00:00:00', 1, 'cover021.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=776314610&bvid=BV1x14y1N7nR&cid=923962989&p=1&danmaku=0', '美国', 'action', 8.8);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (22, '布达佩斯大饭店', '故事要从一位无名作家（裘德·洛 Jude Law 饰）说起，为了专心创作，他来到了名为“布达佩斯”的饭店，在这里，作家遇见了饭店的主人穆斯塔法（F·莫里·亚伯拉罕 F. Murray Abraham 饰），穆斯塔法邀请作家共进晚餐，席间，他向作家讲述了这座饱经风雨的大饭店的前世今生。', '2014-02-06 00:00:00', 0, 'cover022.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=594872869&bvid=BV1dq4y1e7zw&cid=550176849&p=1&danmaku=0', '德国', 'comedy', 8.9);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (23, '低俗小说', '《低俗小说》由“文森特和马沙的妻子”、“金表”、“邦妮的处境”三个故事以及影片首尾的序幕和尾声五个部分组成。看似独立的小故事里面，却又有环环相扣的人和事。', '1994-05-12 00:00:00', 1, 'cover023.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=7425098&bvid=BV1ms411Y7oi&cid=12141633&p=1&danmaku=0', '美国', 'comedy', 8.9);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (24, '摩登时代', '二十年代的美国处于经济萧条时期，失业率居高不下，工人受尽压榨，成为了大机器生产中的一颗螺丝钉。查理（查理·卓别林 Charles Chaplin 饰）就是一个底层市民，他在一个机器隆隆的厂房里日以继夜地工作，以赚取微薄的收入。重复繁重的工作压得他喘不过气，他把人们的鼻子当成螺丝钉来拧，卷入流水线机器的皮带里，令人苦笑不得。', '1936-02-25 00:00:00', 0, 'cover024.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=9840462&bvid=BV1gx411D7hk&cid=16268883&p=1&dannmaku=0', '美国', 'comedy', 9.3);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (25, '功夫', '阿星假冒“斧头帮”成员试图在一个叫“猪笼城寨”的地方对居民敲诈，不想引来真的“斧头帮”与“猪笼城寨”居民的恩怨。“猪笼城寨”原是藏龙卧虎之处，居民中有许多身怀绝技者（元华、梁小龙等），他们隐藏于此本是为远离江湖恩怨，不想麻烦自动上身，躲都躲不及。而在观战正邪两派的斗争中，阿星逐渐领悟功夫的真谛。', '2004-12-23 00:00:00', 0, 'cover025.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=339286507&bvid=BV1ZR4y1V7Cn&cid=517069743&p=1&danmaku=0', '中国', 'action', 8.8);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (26, '周处除三害', '通缉犯陈桂林（阮经天 饰）在逃亡藏匿中失去最后一个亲人，同时得知自己只有不到三个月的生命。万念俱灰的他原打算投案自首，可是当发现他在三大通缉犯中仅仅排名第三时，内心突然躁动起来。在此之后，他决定仿效古时候周处除三害的故事，临终之际要在江湖上留下他的传奇名号。通过地下医生张贵卿（谢琼煖 饰），陈桂林找到了分别排名第二和第一的香港仔（袁富华 饰）和牛头的线索，随后踏上征途。贪嗔痴，三毒熬煎，红尘混沌之人，被业障缠绕，永远无法跳脱因果轮回……', '2023-10-06 00:00:00', 0, 'cover026.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=1001473946&bvid=BV1mx4y1D75N&cid=1458341753&p=1&danmaku=0', '中国', 'action', 8.1);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (27, '灭世男孩', '男孩（比尔·斯卡斯加德 饰）天生聋哑，但拥有丰富的想象力，某天，他的家人遭到统治这个国度的暴君希尔达（法米克·詹森 饰）杀害，男孩因此逃到丛林内，接受一位神秘萨满的训练，压抑自己幼稚的想象力，化身为无坚不摧的杀人机器，只为了替家人复仇⋯', '2023-09-09 00:00:00', 1, 'cover027.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=1204784946&bvid=BV1Ef42127ai&cid=1556030817&p=1&danmaku=0', '德国', 'action', 6.3);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (28, '哥斯拉大战金刚2：帝国崛起', '继上一次的怪兽高燃对战之后，金刚和哥斯拉将再度联手对抗一个潜伏在世界中的巨大威胁，并逐步探索这些巨兽们的起源以及骷髅岛等地的奥秘。同时，上古之战的面纱也将会被揭晓，而正是那场战斗创造出了这些超凡的生物，并深刻影响了人类世界的命运。', '2024-03-27 00:00:00', 0, 'cover028.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=1854717047&bvid=BV1Ms421w7Dw&cid=1548860337&p=1&danmaku=0', '美国', 'action', 6.7);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (29, '老狐狸', '故事发生在1990年全民皆股的年代，小男孩廖界（白润音 饰）与父亲廖泰来（刘冠廷 饰）相依为命，他们相信人性本善，没发现世界正在改变。股市飙涨、物价翻倍，有人一夕暴富，有人意识到现实残酷；单纯老实的廖界父子属于后者。不料，他们碰上了聪明狡猾的“老狐狸”（陈慕义 饰），命运道路可能截然不同。财富与良心两条岔路，该怎么选？', '2023-10-27 00:00:00', 1, 'cover029.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=1553130924&bvid=BV1o1421o7U8&cid=1504313389&p=1&danmaku=0', '中国', 'action', 8.1);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (30, '功夫熊猫4', '神龙大侠阿宝（杰克·布莱克 Jack Black 配音）再度归来，要被师父（达斯汀·霍夫曼 Dustin Hoffman 配音）强行进阶修行。系列全新最强反派魅影妖后（维奥拉·戴维斯 Viola Davis 配音）登场，神秘莫测的她可以幻化成每一个阿宝的昔日宿敌。此次阿宝又结识了小真（奥卡菲娜 Awkwafina 配音）等新伙伴，并将一同开启这场冒险旅程。', '2024-03-08 00:00:00', 1, 'cover030.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=1803492324&bvid=BV1At421777c&cid=1511755309&p=1&danmaku=0', '美国', 'animation', 6.4);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (31, '没有一顿火锅解决不了的事', '人在做，天在看，人算终究不如天算。四个互不相识的人在戏院后台库房分赃，竟意外牵扯进一桩命案，一顿热辣滚烫的火锅翻滚着层出不穷的悬疑，贪婪和欺瞒引发连环逆转。终于，四人特殊身份渐渐浮出水面，神秘的真相也呼之欲出……', '2024-05-01 00:00:00', 1, 'cover031.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=1954876770&bvid=BV1Ly411a7aL&cid=1552694096&p=1&danmaku=0', '中国', 'comedy', 5.1);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (32, '第二十条', '人过中年的检察官韩明（雷佳音 饰）早已没了往日的锋芒，每日里柴米油盐，鸡毛蒜皮，尽快从挂职转正是他最为关心的问题。在此期间，康村王永强（潘斌龙 饰）为保护哑巴妻子（赵丽颖 饰）捅伤村霸刘文经（阿如那 饰）的案件甚嚣尘上。刘的家人纠集村匪恶霸上访闹事，要求判处王死刑。韩明的初恋女友——女检察官吕玲玲（高叶 饰）顶住各方压力，执意要找到关系案件走向的重要证据。另一方面，韩的儿子韩雨辰（刘耀文 饰）为制止校园霸凌将学校张主任（张译 饰）儿子打伤，关于是否应该道歉，双方展开了拉锯战。', '2024-02-10 00:00:00', 0, 'cover032.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=1353736449&bvid=BV1sz421S79Q&cid=1521480163&p=1&danmaku=0', '中国', 'comedy', 7.5);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (33, '你想活出怎样的人生', '少年牧真人（山时聪真 配音）的母亲葬身火海后，他随父亲牧胜一（木村拓哉 配音）与继母夏子（木村佳乃 配音）组成新家庭。深陷悲伤的真人阴郁孤僻，难以融入新环境。一次意外，他跟随一只会说话的苍鹭（菅田将晖 配音）闯入废弃的神秘塔楼，却不料进入了奇幻的“亡灵世界”，开始了一场不可思议的冒险……', '2023-07-14 00:00:00', 0, 'cover033.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=1152655135&bvid=BV1fZ421v75q&cid=1493616569&p=1&danmaku=0', '日本', 'animation', 7.6);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (34, '红辣椒', '近未来，为了治疗现代人类越来越多、越来越严重的精神疾病，位于东京的精神医疗综合研究所开发出一种可以反映他人梦境的机器。通过微型DC的帮助，梦境在显示器上呈现出来，更方便找到一个人焦虑的症结。　　某日，三台微型DC失窃，与之相关的研究人员的梦境接连被人侵入，随后受到严重伤害。美女医疗师千叶敦子另一个身份是梦境侦探“红辣椒”，她能够与患者同步体验梦境。为避免盗贼利用微型DC进一步作恶，她不得不潜入受害者的梦中寻找恐怖分子，一场充满奇幻和惊险的争斗旋即展开……', '2006-09-02 00:00:00', 0, 'cover034.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=7410571&bvid=BV1ds411Y7um&cid=12115795&p=1&danmaku=0', '日本', 'animation', 9.1);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (35, '罗小黑战记', '这是一个人类和妖怪共存的世界，他们相安无事，惬意悠然。宁静的大森林中，黑色猫妖罗小黑（山新 配音）赖以生存的家园被毁，它只能四处流浪，无所依靠。在城市角落觅食的时候，罗小黑受到人类的欺负。关键时刻，同为妖怪的风息（郝祥海 配音）出手相助，并将其带回妖怪们的聚集点。本以为终于找到了家庭的温暖，可谁想到强悍的人类无限（刘明月 配音）的出现，打破了小黑期望的一切。而在乱斗中，小黑更被无限掳走。', '2019-08-27 00:00:00', 0, 'cover035.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=963805731&bvid=BV1RH4y127vs&cid=1343943184&p=1&danmaku=0', '中国', 'animation', 8.0);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (36, '新神榜：杨戬', '商周之战一千五百年后，天界衰落，蒙冤落魄的杨戬以赏银捕手为业谋生。一日，杨戬接受了一位神秘访客的赏银去追捕一位少年，意外发现少年竟是自己的亲外甥沉香。沉香立志要寻回宝莲灯，劈山救母，却将酿成大祸。杨戬踏上追寻沉香并揭开尘封往事的旅程……', '2022-08-19 00:00:00', 1, 'cover036.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=907890124&bvid=BV1BM4y1R7nX&cid=1037331085&p=1&danmaku=0', '中国', 'animation', 7.0);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (37, '关于我的父亲', '罗伯特·德尼罗将携手塞巴斯蒂安·马尼斯科，主演狮门影业喜剧新片《关于我的父亲》(About My Father)。该片由劳拉·特鲁索执导，特鲁索与奥斯汀·厄尔共同操刀剧本。影片根据马尼斯科与父亲的真实经历改编，讲述马尼斯科告诉他老派的意大利移民父亲萨尔沃(德尼罗饰)，他要向他的纯美国女友求婚时，萨尔沃坚持要和她的父母一起过周末。两家人在一起的时候，虽然有文化冲突，而且两个家庭似乎没有什么共同点，但在周末结束时，他们成为了一家人。', '2023-05-26 00:00:00', 0, 'cover037.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=831698219&bvid=BV1E34y1V7tQ&cid=1286152220&p=1&danmaku=0', '美国', 'comedy', 6.1);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (38, '泡泡', '地心引力不再的东京，一名男孩和女孩相互倾心……世界各地降下一阵泡泡雨，地心引力定律就此瓦解，故事在此时从东京开展。东京与外界彻底隔绝，成了一群年轻孤儿的游乐场。大伙在此成群结队，穿梭跳跃各个建筑，上演跑酷大战。以危险的游戏风格闯出名号的年轻好手响，某天不慎失足，坠入扭转重力的海里，幸而被掌握神秘力量的女孩诗搭救。接着，俩人竟听见别人完全无法耳闻的独特声响。诗为何会出现在响的面前？俩人相遇，继而揭开足以改变世界的真相。', '2022-05-13 00:00:00', 0, 'cover038.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=832293181&bvid=BV1U34y1g7jg&cid=1304850855&p=1&danamku=0', '日本', 'animation', 5.7);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (39, '加菲猫家族', '影片聚焦加菲猫家族，原本“猫生”只有吃吃睡睡的加菲猫（克里斯·帕拉特 Chris Pratt 配音）和小狗欧迪（哈维·吉兰 Harvey Guillen 配音）遭遇神秘反派的绑架，并因此与加菲猫父亲维克（塞缪尔·杰克逊 Samuel L. Jackson 配音）重逢重逢，两猫一狗的组合被迫踏上惊险刺激又欢笑不断的冒险之旅。', '2024-05-01 00:00:00', 1, 'cover039.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=1555155564&bvid=BV1S142117jW&cid=1561299748&p=1&danmaku=0', '英国', 'animation', 8.0);
INSERT INTO movie (movie_id, movie_title, movie_description, release_date, need_vip, movie_cover_url, video_url, movie_region, movie_type, movie_score) VALUES (40, '你好世界', '在京都居住的内向男高中生直实（北村匠海 配音）的面前，突然出现从10年后穿越而来26岁的自己（松坂桃李 配音）。未来的直实告诉他，自己不久便会与瑠璃（滨边美波 配音）相爱，可是之后烟花大会时她却会因为一场事故意外离世。为了拯救爱人，16岁的直实卷入了这场现实与虚拟的记忆世界，经历了一系列超乎想象的事情。即使世界毁灭，我也想再见你一面。', '2019-09-20 00:00:00', 0, 'cover040.jpg', 'player.bilibili.com/player.html?isOutside=true&aid=248510968&bvid=BV1Zv411V7Rx&cid=353587690&p=1&danmaku=0', '日本', 'animation', 6.8);
